    @Override
    public void onUpgrade(SQLiteDatabase db, int oldVersion, int newVersion) {
        db.execSQL("DROP TABLE IF EXISTS "+ TrainingDTO.HISTORY_TABLE);
        db.execSQL("DROP TABLE IF EXISTS "+ UserDTO.USER_TABLE);
        db.execSQL("DROP TABLE IF EXISTS "+DisciplineDTO.DISCIPLINE_TABLE);
        db.execSQL("DROP TABLE IF EXISTS "+DisciplineSubDTO.DISCIPLINESUB_TABLE);
        db.execSQL("DROP TABLE IF EXISTS "+LevelDTO.POZIOM_TABLE);
        db.execSQL("DROP TABLE IF EXISTS "+PlanDTO.PLAN_TABLICA);
        db.execSQL("DROP TABLE IF EXISTS "+ TrainingInPlanDTO.CWICZENIE_TABELA);
        onCreate(db);
    }
